import React, { useEffect, useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import LoginScreen from './screens/auth/LoginScreen';
import HomeScreen from './screens/home/HomeScreen';
import VisitListScreen from './screens/visits/VisitListScreen';
import AddVisitScreen from './screens/visits/AddVisitScreen';
import VisitDetailScreen from './screens/visits/VisitDetailScreen';
import { View, ActivityIndicator, Text } from 'react-native';

const Stack = createStackNavigator();

const App = () => {
  // Version simplifiée sans vérification initiale pour déboguer
  console.log("Application démarrée"); // Pour confirmer que l'app démarre

  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Login">
        <Stack.Screen 
          name="Login" 
          component={LoginScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen 
          name="Home" 
          component={HomeScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen 
          name="VisitList" 
          component={VisitListScreen}
          options={{ title: 'Mes Visites' }}
        />
        <Stack.Screen 
          name="AddVisit" 
          component={AddVisitScreen}
          options={{ title: 'Nouvelle Visite' }}
        />
        <Stack.Screen 
          name="VisitDetail" 
          component={VisitDetailScreen}
          options={{ title: 'Détail de la visite' }}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
